export class HeaderContainer extends React.Component {

    componentDidMount() {
        axios.get(`https://social-network.samuraijs.com/api/1.0/auth/me`)
            .then(response => {
                this.props.data;
            });
    }

    render() {
        return <Header {...this.props}/>
    }
}
